// import App from './App';
import React from 'react';
import { createRoot } from 'react-dom/client';
import Slider from 'react-slick';

export default function SimpleSlider() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };
  return (
    <Slider {...settings}>
      <div>
        <h3>1</h3>
      </div>
      <div>
        <h3>2</h3>
      </div>
      <div>
        <h3>3</h3>
      </div>
      <div>
        <h3>4</h3>
      </div>
      <div>
        <h3>5</h3>
      </div>
      <div>
        <h3>6</h3>
      </div>
    </Slider>
  );
}

const root = createRoot(document.getElementById('root'));
root.render(
  <>
    <h1>hello</h1>
    <SimpleSlider />
  </>
);
